def loop(sta_if, epd):
    lastm = ""
    lasth = ""
    while True:
        t = utime.localtime()
        h = str(t[0]) + ':' + str(t[1]) + ':' + str(t[2]) + ':' + str(t[3])
        m = h + ':' + str(t[4])
        if m != lastm:
            if t[0] == 2021 and t[1] == 1 and t[2] == 1:  # time is not right, set up from network
                inittime()
            else:
                lastm = m
                epd.fill_rect(0, 0, 47, 122, 0xff)
                epd.text(on2(t[3]) + ":" + on2(t[4]), 2, 8, 0x00)
                epd.text(daysOfWeek[t[6]], 0, 90, 0x00)
                epd.text(on2(t[2]) + "/" + on2(t[1]), 2, 105, 0x00)
                epd.text(on2(t[0]), 7, 120, 0x00)
                epd.ellipse(22, 51, 21, 21, 0x00)
                epd.ellipse(22, 51, 22, 22, 0x00)
                epd.line(0, 51, 3, 51, 0x00)
                epd.line(41, 51, 44, 51, 0x00)
                epd.line(22, 29, 22, 32, 0x00)
                epd.line(22, 70, 22, 73, 0x00)
                drawLine(epd, 22, 51, 21, t[4] / 60)
                drawLine(epd, 22, 51, 10, t[3] / 12)
                drawLine(epd, 22, 51, 10, t[3] / 12 + 0.015)
                drawLine(epd, 22, 51, 10, t[3] / 12 - 0.015)
                epd.display_Partial(epd.buffer)

#                 reading = sensor_temp.read_u16() * conversion_factor
#                 temp = round(27 - (reading - 0.706) / 0.001721, 1)
#                 epd.fill_rect(54, 109, 196, 13, 0xff)
#                 epd.text("Inside:" + str(temp) + "c", 56, 109, 0x00)
#                 epd.display_Partial(epd.buffer)

        if h != lasth:
#             if not sta_if.isconnected():
#                 STA_Setup(wifiAP, sta_if)
            if not sta_if.isconnected():
                continue
            lasth = h
            epd.fill_rect(54, 0, 196, 108, 0xff)
            try:
#                 pinged = uping.ping("********", count=1, timeout=1000, interval=10, quiet=True, size=64)
#                 if pinged[1]==1:
#                     epd.text(": Online",56,38,0x00)
#                 else:
#                     epd.text("server: Offline",56,38,0x00)
                resp = urequests.get(WEATHER).json()
                resp2 = urequests.get(speedtestServer).json()
                i = 0
                while i<=3:
                    epd.text(resp["weather"][0]["description"], 56, 8, 0x00)
                    ico = resp["weather"][0]["icon"][0:2]
                    if ico in icons:
                        fbuf = framebuf.FrameBuffer(icons[ico], 50, 50, framebuf.MONO_HLSB)
                        epd.blit(fbuf, 200, 25)
                    epd.fill_rect(56, 13, 194, 1, 0x00)
                    epd.text("Temp:  " + str(resp["main"]["temp"]) + "C", 56, 19, 0x00)
                    epd.text("Feels: " + str(resp["main"]["feels_like"]) + "C", 56, 34, 0x00)
                    epd.text("Min:   " + str(resp["main"]["temp_min"]) + "C", 56, 49, 0x00)
                    epd.text("Max:   " + str(resp["main"]["temp_max"]) + "C", 56, 64, 0x00)
                    epd.text("Humidity: " + str(resp["main"]["humidity"]) + "%", 56, 79, 0x00)
                    epd.text("Pressure: " + str(resp["main"]["pressure"]) + "hPa", 56, 94, 0x00)
                    
                    download = int(resp2["data"]["download"])
                    upload = int(resp2["data"]["upload"])
                    epd.text("Download speed: " + str(download) + " MB/s",56,109,0x00)
                    epd.text("Upload speed: " + str(upload) + " MB/s",56,120,0x00)
                    i+=1
                    epd.delay_ms(20)
                    epd.display_Partial(epd.buffer)
            except:
                # give up
                pass
            epd.display_Partial(epd.buffer)
        epd.delay_ms(1000)
        
if not button.value():
    print('Button pressed!')
    clearScr=True
if clearScr:
    epd = EPD_2in13()
    epd.Clear()
    epd.delay_ms(2000)
    epd.sleep()
    epd.delay_ms(2000)
